import { Component } from "react";

import { BrowserRouter, Routes, Route, Router } from "react-router-dom";
import Home from "./homeComponant";

class Main extends Component {
  render() {
    return (
      <BrowserRouter>
        <Router>
          <Route path="/" element={<Home />} />
        </Router>
      </BrowserRouter>
    );
  }
}
export default Main;
